Ext.data.JsonP['Dashboard_4.5.3_Release_Note']({"guide":"<?xml version=\"1.0\" encoding=\"UTF-8\" ?>\n<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\"\n        \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\n<html xmlns=\"http://www.w3.org/1999/xhtml\">\n<head>\n    <title>Dashboard 4.5.3</title>\n\n    <meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\">\n    <meta content=\"Scroll EclipseHelp Exporter\" name=\"generator\">\n\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\" media=\"print\">\n</link></link></link></meta></meta></head>\n<body>\n    <div class=\"container\">\n        <div class=\"header\"/>\n\n        <div id=\"src-46243488\" class=\"content\">\n                        <h1>Dashboard 4.5.3</h1>\n    <p>Dashboard 4.5.3 is a patch release, which includes an improvement and one bug fix.    </p>\n    <div class=\"section section-2 \" id=\"src-46243488_Dashboard4.5.3ReleaseNote-Improvement\">\n        <h2 class=\"heading \"><span>Improvement</span></h2>\n<ul class=\" \"><li class=\"p1 \">    <p>ArrowDB overview now shows the current month-to-date API usage and allows you to toggle to the previous calendar month&apos;s usage.    </p>\n</li></ul>    <p>    <span style=\"color: #2b4771;\">\nFixed Issue    </span>\n    </p>\n<ul class=\" \"><li class=\" \">    <p>Fixed link to Dashboard iOS Push Configuration documentation to point to the correct document.    </p>\n</li></ul>    </div>\n        </div><a id=\"editButton\" href=\"https://wiki.appcelerator.org/pages/editpage.action?pageId=46243488\"><span>Edit</span></a>\n    \n        \n    </div>\n</body>\n</html>\n","title":"Dashboard 4.5.3 Release Note"});